import React,{useContext} from 'react'
import AuthContext from '../context/AuthContext'

const Header = () => {
  
  const {user,logoutUser} = useContext(AuthContext)

  
  return user?
  (<p onClick={logoutUser}>Logout</p>)
  :null
}

export default Header
